import VueRouter from "vue-router";
import Content from "@/pages/Content";
import Login from "@/pages/login"
import Logon from "@/pages/logon"

const router = new VueRouter({
    routes : [
        {
            path: '/',
            redirect:'/home',
        },
        {   
            path:'/home',
            component: Content
        },
        {
            path:'/login',
            component: Login
        },
        {
            path:'/logon',
            component: Logon
        },

    ],

    mode:'history'
})

export default router
